import * as actions from '../../../Store/Actions/Index'; 
import {Redirect} from 'react-router-dom';
import Navbar from '../../../Components/Navbar/Navbar';
import Sidebar from '../../../Components/Sidebar/Sidebar';
import React, { Component, useState, useEffect } from 'react';
import { connect } from 'react-redux';
import FormData from 'form-data'; 

const ViewOrgs = props =>{
    const[gotOrganizations, setGotOrganizations] = useState([])



    useEffect (()=>{
        let token = localStorage.getItem('token')
        props.onFetchOrganizations(token);
    },[]);

    let sidebar = <Sidebar/>;
    let navbar =  <Navbar name ={localStorage.getItem('name')}/>;
    let count = 0;
    let orgzs=  <Sidebar/>;
    if(!props.loading){
        console.log('ok to go')
        let orgzsArr = props.organizations;
        //console.log(orgzsArr);
        for (let i=0;i<orgzsArr.length;i++){
            console.log(i)

        }

        orgzs= props.organizations.map(event => (<div className="col-md-6 col-lg-4 col-xl-3">
        <figure className="snip1527" >
          <div className="image"><img src={require("./new_img.jpg")} /></div>
          <figcaption>
            <div className="date"><span className="day">GO</span><span className="month">FUND!</span></div>
            <h3>NAME: {event.name}</h3>
            <h3>OWNER: {event.owner}</h3>
            <h3>Organization ID :{event.OrgId}</h3>
          </figcaption>
          <a ></a>
        </figure>
      </div>
      ))
    }

    return(
        <div className="myfunds">
            {navbar}
            {sidebar}
            {orgzs}
        </div>

    )

    }



const mapAllOrganizationsDispatchToProps =dispatch => {

    return{
        onFetchOrganizations:(token) =>dispatch(actions.fetchOrganizations(token)),
        //onFetchOneEvents:(OrganizationId)=>dispatch(actions.fetchOneOrganizations(fundId))
    };
}


//to access the errors and loading state 
const mapStatetoProps = state =>{
    console.log('main page vworg',state.organizations.organizations)
    return {
    organizations: state.organizations.organizations,
    loading:state.organizations.loading,
    token:state.auth.token
    };
};


export default connect(mapStatetoProps, mapAllOrganizationsDispatchToProps)(ViewOrgs);
